import React, {Component} from 'react';
import {connect} from 'react-redux';

class PresentedQuestions extends Component {

    componentDidUpdate(prevProps) {
        // Typical usage (don't forget to compare props):
        if (this.props.questions !== prevProps.questions) {
            this.fetchData(this.props.userID);
        }
    }

    render() {
        console.log(this.props);
        const questions = typeof this.props.questions === 'undefined' ? [] : this.props.questions;
        console.log(questions);
        const presentedQuestions = questions.map(questionItem => (
            <div>
                <h3>{questionItem.question}</h3>
            </div>
        ));
        return (
            <div>
                <h3>Created questions</h3>
                {presentedQuestions}
            </div>
        );
    }
}

